import React from 'react';
import './BuyFromFarmers.css';
import sampleImage from '../assets/sampleImage.png'; // Replace with the actual path to the image
import potato from "../assets/potato.png"

function BuyFromFarmers() {
  return (
    <div className="cards-container">
      <h2>Buy from Farmers</h2>
      <img src={sampleImage} alt="Top Right" className="top-right-image" />
      <div className="items-container">
        {/* Example Card */}
        <div className="card">
          <img src={potato} alt="Crop" />
          <div className="card-text">
            <h3>Wheat</h3>
            <p>Freshly harvested</p>
            <p>Quantity: 500kg</p>
          </div>
        </div>
        {/* Add more cards as needed */}
      </div>
    </div>
  );
}

export default BuyFromFarmers;
